import React, { useContext, useState } from 'react'
import AuthContext from './AuthContext'

const Logout = () => {
    let [authState, setAuthState] = useState
    const {auth} = useContext(AuthContext)
    console.log(auth)

  return (
    <div>Logged out</div>
  )
}

export default Logout
